window.onload = function () {
  function inIframe() {
    try {
      return window.self !== window.top;
    } catch (e) {
      return true;
    }
  }

  if (inIframe()) {
    return;
  }

  const obs = new MutationObserver(async (muts, obs) => {
    muts.map(async (mut) => {
      let target = mut.target;
      let id = target.getAttribute("id");
      if (!id) {
        return;
      }
      if (!id.startsWith("google_ads_iframe")) {
        return;
      }
      target.setAttribute("id", "uhoh_ads_iframe");
      let nodes = Array.from(mut.addedNodes);
      let height, width;
      await Promise.all(
        nodes.map(async (node) => {
          let nodeId = node.getAttribute("id");
          if (!id) {
            return;
          }
          if (!id.startsWith("google_ads_iframe")) {
            return;
          }
          height = node.getAttribute("height");
          width = node.getAttribute("width");
          let img = document.createElement("img");
          img.src =
            "data:image/jpeg;base64,";
          img.style = "max-height: 100%; max-width: 100%";
          node.replaceWith(img);
        })
      );
      target.style = `width: ${width}px; height: ${height}px; display: flex; place-items: center; justify-content: center; background-color: #0078d7`;
      if (target.parentElement.clientWidth > width) {
        target.style.width = `${target.parentElement.clientWidth}px`;
      }
      if (target.parentElement.clientHeight > height) {
        target.style.height = `${target.parentElement.clientHeight}px`;
      }
    });
  });

  obs.observe(document.body, { childList: true, subtree: true });
};
